ColorChanger.prototype.HIGHLIGHT_COLOR_PERCENT=0.6;ColorChanger.prototype.SHADOW_COLOR_PERCENT=-0.4;ColorChanger.prototype.TIME_UNTIL_HOVER_OVER_COLOR=1;ColorChanger.prototype.TIME_UNTIL_HOVER_OUT_COLOR=3;function ColorChanger(a){this.backgroundColorElement=a;this._onMouseOverHandler=function(){var c=this;var d=this.backgroundColorElement.style;return function(){document.getElementsByClassName("gradient_background")[0].style.backgroundColor=convertHex(blendColors(this.highlightHoverColor,"#ffffff",0.5),0.4);document.getElementsByClassName("gradient_background")[0].style.transitionDuration=c.TIME_UNTIL_HOVER_OVER_COLOR+"s";d.transitionDuration=c.TIME_UNTIL_HOVER_OVER_COLOR+"s";d.backgroundColor=this.shadowHoverColor}};this._onMouseOutHandler=function(){var c=this;var d=this.backgroundColorElement.style;return function(){document.getElementsByClassName("gradient_background")[0].style.backgroundColor="";document.getElementsByClassName("gradient_background")[0].style.transitionDuration=c.TIME_UNTIL_HOVER_OUT_COLOR+"s";d.transitionDuration=c.TIME_UNTIL_HOVER_OUT_COLOR+"s";d.backgroundColor=""}};this._processFlexItem=function(d){d.hoverColor=d.getAttribute("data-hovercolor");d.highlightHoverColor=colorLuminance(d.hoverColor,this.HIGHLIGHT_COLOR_PERCENT);d.shadowHoverColor=colorLuminance(d.hoverColor,this.SHADOW_COLOR_PERCENT);d.style.backgroundColor=colorLuminance(d.hoverColor,this.SHADOW_COLOR_PERCENT*2);var c=d.querySelector(".text_bg").style;c.backgroundColor=d.hoverColor;c.borderTopColor=d.highlightHoverColor;c.borderBottomColor=d.shadowHoverColor;d.onmouseover=this._onMouseOverHandler();d.onmouseout=this._onMouseOutHandler()};this.start=function(){var d=document.getElementsByClassName("flex_item");for(var c=0;c<d.length;c++){this._processFlexItem(d[c])}}}function convertHex(c,a){c=c.replace("#","");r=parseInt(c.substring(0,2),16);g=parseInt(c.substring(2,4),16);b=parseInt(c.substring(4,6),16);result="rgba("+r+","+g+","+b+","+a+")";return result}function blendColors(k,j,c){var l=parseInt(k.slice(1),16),o=parseInt(j.slice(1),16),h=l>>16,d=l>>8&255,n=l&255,e=o>>16,a=o>>8&255,m=o&255;return"#"+(16777216+(Math.round((e-h)*c)+h)*65536+(Math.round((a-d)*c)+d)*256+(Math.round((m-n)*c)+n)).toString(16).slice(1)}function colorLuminance(e,a){e=String(e).replace(/[^0-9a-f]/gi,"");var d="#";var c;for(i=0;i<3;i++){c=parseInt(e.substr(i*2,2),16);c=Math.round(Math.min(Math.max(0,c+(c*a)),255)).toString(16);d+=("00"+c).substr(c.length)}return d}function executeMobileJavascript(){var c=document.getElementsByClassName("flex_item");var d=document.getElementsByClassName("text_link");for(var a=0;a<d.length;a++){d[a].className+=" mobile"}for(var a=0;a<c.length;a++){c[a].querySelector("a").className+=" hover"}}function moreButtonOn(a,c){a.color="black";a.backgroundColor="white";c.display="block"}function moreButtonOff(a,c){a.color="";a.backgroundColor="";c.display="none"}moreMenuOnclickHandler=function(a,c){return function(){if(c.display!=="none"){moreButtonOff(a,c)}else{moreButtonOn(a,c)}}};function setupMoreMenu(){var a=document.getElementById("show_navbar").querySelector("a").style;var c=document.getElementById("navbar_more").style;moreButtonOff(a,c);document.getElementById("show_navbar").onclick=moreMenuOnclickHandler(a,c)}function runJavascript(){if("transitionProperty" in document.body.style){var a=new ColorChanger(document.body);a.start()}if("ontouchstart" in window){executeMobileJavascript()}setupMoreMenu()}runJavascript();